INSERT INTO `disease_categories` (`discat_id`, `discat_name`, `discat_author`, `discat_token`, `discat_description`, `discat_regdate`) VALUES
(2,	'Communicable (Infectious)',	'NIT/PF/0004',	200,	'Diseases that spread from one person to another. Usually caused by microorganisms called pathogens (fungi, rickettsia, bacteria, viruses, protozoans, and worms).',	'2022-10-22 02:18:41'),
(3,	'Non-communicable (Non-infectious)',	'NIT/PF/0004',	201,	'These diseases are caused by pathogens, but other factors such as age, nutritional deficiency, gender of an individual, and lifestyle also influence the disease. Examples include hypertension, diabetes, and cancer. They do not spread to others and they restrain within a person who has contracted them',	'2022-10-22 02:20:14');
